create table cities
(
    id               int unsigned auto_increment
        primary key,
    address          text null,
    postal_code      text null,
    country          text null,
    federal_district text null,
    region_type      text null,
    region           text null,
    area_type        text null,
    area             text null,
    city_type        text null,
    city             text null,
    settlement_type  text null,
    settlement       text null,
    kladr_id         text null,
    fias_id          text null,
    fias_level       int  null,
    capital_marker   int  null,
    okato            text null,
    oktmo            text null,
    tax_office       text null,
    timezone         text null,
    lat              text null,
    lon              text null,
    population       int  null,
    foundation_year  int  null
);

